#[cfg(test)]
mod test {
    use super::*;

    #[test]
    fn abandon_to_darkside_10_000_000_zat() {
        decode_tx(ABANDON_TO_DARKSIDE_SAP_10_000_000_ZAT);
    }
    #[test]
    fn darkside_sap_to_sap_50_000_zat() {
        decode_tx(DARKSIDE_SAP_TO_SAP_50_000_ZAT);
    }

    fn decode_tx(hex_transaction: &str) {
        let tx = hex::decode(hex_transaction).unwrap();
        zcash_primitives::transaction::Transaction::read(
            &tx[..],
            zcash_primitives::consensus::BranchId::Nu5,
        )
        .unwrap();
    }
}
